IF NOT EXISTS(SELECT * FROM sys.databases WHERE name = 'YourTubeDb')
BEGIN
    CREATE DATABASE [YourTubeDb];
END
GO

USE [YourTubeDb]
GO

BEGIN TRANSACTION;
GO

IF NOT EXISTS(SELECT * FROM sys.tables WHERE name = 'Users')
BEGIN
	CREATE TABLE [Users] (
		[Id] int NOT NULL IDENTITY,
		[Username] nvarchar(max) NULL,
		[Password] nvarchar(max) NULL,
		[ProfileImageUrl] nvarchar(max) NULL,
		[CreateTime] datetime2 NOT NULL,
		[LastEditTime] datetime2 NOT NULL,
		CONSTRAINT [PK_Users] PRIMARY KEY ([Id])
	);
END
GO

IF NOT EXISTS(SELECT * FROM sys.tables WHERE name = 'VideoViews')
BEGIN
	CREATE TABLE [VideoViews] (
		[Id] int NOT NULL IDENTITY,
		[VideoId] int NOT NULL,
		[Username] nvarchar(max) NULL,
		[CreateTime] datetime2 NOT NULL,
		[LastEditTime] datetime2 NOT NULL,
		CONSTRAINT [PK_VideoViews] PRIMARY KEY ([Id])
	);
END
GO

IF NOT EXISTS(SELECT * FROM sys.tables WHERE name = 'Videos')
BEGIN
	CREATE TABLE [Videos] (
		[Id] int NOT NULL IDENTITY,
		[Title] nvarchar(max) NULL,
		[VideoUrl] nvarchar(max) NULL,
		[Liked] int NOT NULL,
		[Disliked] int NOT NULL,
		[Views] int NOT NULL,
		[UserId] int NOT NULL,
		[CreateTime] datetime2 NOT NULL,
		[LastEditTime] datetime2 NOT NULL,
		CONSTRAINT [PK_Videos] PRIMARY KEY ([Id]),
		CONSTRAINT [FK_Videos_Users_UserId] FOREIGN KEY ([UserId]) REFERENCES [Users] ([Id]) ON DELETE CASCADE
	);
END
GO

IF NOT EXISTS(SELECT * FROM sys.tables WHERE name = 'Comments')
BEGIN
	CREATE TABLE [Comments] (
		[Id] int NOT NULL IDENTITY,
		[Content] nvarchar(max) NULL,
		[Username] nvarchar(max) NULL,
		[VideoId] int NOT NULL,
		[CreateTime] datetime2 NOT NULL,
		[LastEditTime] datetime2 NOT NULL,
		CONSTRAINT [PK_Comments] PRIMARY KEY ([Id]),
		CONSTRAINT [FK_Comments_Videos_VideoId] FOREIGN KEY ([VideoId]) REFERENCES [Videos] ([Id]) ON DELETE CASCADE
	);
END
GO

IF NOT EXISTS(SELECT * FROM sys.tables WHERE name = 'Comments')
BEGIN
	CREATE TABLE [Favorites] (
		[Id] int NOT NULL IDENTITY,
		[VideoId] int NOT NULL,
		[Username] nvarchar(max) NULL,
		[CreateTime] datetime2 NOT NULL,
		[LastEditTime] datetime2 NOT NULL,
		CONSTRAINT [PK_Favorites] PRIMARY KEY ([Id]),
		CONSTRAINT [FK_Favorites_Videos_VideoId] FOREIGN KEY ([VideoId]) REFERENCES [Videos] ([Id]) ON DELETE CASCADE
	);
END
GO

IF NOT EXISTS(SELECT * FROM sys.tables WHERE name = 'Likes')
BEGIN
	CREATE TABLE [Likes] (
		[Id] int NOT NULL IDENTITY,
		[Liked] bit NOT NULL,
		[Disliked] bit NOT NULL,
		[Username] nvarchar(max) NULL,
		[VideoId] int NOT NULL,
		[UserId] int NULL,
		[CreateTime] datetime2 NOT NULL,
		[LastEditTime] datetime2 NOT NULL,
		CONSTRAINT [PK_Likes] PRIMARY KEY ([Id]),
		CONSTRAINT [FK_Likes_Users_UserId] FOREIGN KEY ([UserId]) REFERENCES [Users] ([Id]),
		CONSTRAINT [FK_Likes_Videos_VideoId] FOREIGN KEY ([VideoId]) REFERENCES [Videos] ([Id]) ON DELETE CASCADE
	);
END
GO

CREATE INDEX [IX_Comments_VideoId] ON [Comments] ([VideoId]);
GO

CREATE INDEX [IX_Favorites_VideoId] ON [Favorites] ([VideoId]);
GO

CREATE INDEX [IX_Likes_UserId] ON [Likes] ([UserId]);
GO

CREATE INDEX [IX_Likes_VideoId] ON [Likes] ([VideoId]);
GO

CREATE INDEX [IX_Videos_UserId] ON [Videos] ([UserId]);
GO

GO

GO

GO

COMMIT;
GO